import styled from 'styled-components';

export const ContactContainer = styled.div`
    background: peach;
    display: flex;
    justify-content: center;
    align-items: center;
    padding: 0 30px;
    height: 300px;
    position: relative;
    z-index: 1;

    @media screen and (max-width: 960px){
        margin-bottom: 100px;
    }

    @media screen and (max-width: 640px){
        margin-bottom: 650px;
        height: 500px;

    }
`;
